css:
.atom-minify .loading-spinner-tiny {
  margin-left: 10px;
}
.atom-minify .right-top-options .btn-close {
  height: 100%;
}
.atom-minify .clickable {
  cursor: pointer;
}
.atom-minify .clickable:hover {
  background-color: #373d48;
}
.atom-minify .target-file-does-not-exist {
  color: #ff6347;
}
.atom-minify .target-file-does-not-exist .hint {
  color: #aaa;
}
.atom-minify .target-file-does-not-exist .hint::before {
  display: inline;
  content: " ï¿½ ";
}
.atom-minify .panel-body {
  padding: 10px 0;
}
.atom-minify .panel-body p {
  margin: 0;
  padding: 4px 10px;
}
.atom-minify .panel-body .success-text-wrapper .success-details {
  color: #888;
}
.atom-minify .panel-body .success-text-wrapper .success-details .success-saved-percentage {
  padding: 0 0 0 21px;
}
.atom-minify .panel-body .success-text-wrapper .success-details .success-duration {
  padding: 0 0 0 12px;
}
.atom-minify .panel-body .success-text-wrapper .success-details .success-size-before {
  padding: 0 0 0 12px;
}
.atom-minify .panel-body .success-text-wrapper .success-details .success-size-after {
  padding: 0 0 0 12px;
}
.atom-minify .panel-body .success-text-wrapper .success-details .success-minifier {
  padding: 0 0 0 12px;
}
.atom-minify .panel-body .success-text-wrapper .success-details .success-file-size {
  padding: 0 0 0 12px;
}
.atom-minify .panel-body .success-text-wrapper .success-details .value {
  padding: 0 0 0 3px;
  font-weight: bold;
}
.atom-minify .panel-body .error-text {
  padding: 0 0 0 7px;
}
.atom-minify .panel-body .error-file-wrapper {
  padding-left: 21px;
}
.atom-minify .panel-body .error-file {
  padding: 0 7px;
}
.atom-minify .panel-body .error-line::before {
  content: '(';
}
.atom-minify .panel-body .error-line::after {
  content: ', ';
}
.atom-minify .panel-body .error-column::after {
  content: ')';
}
